dataset.sql:
${
"select tei.entryid,tei.filingyear,tcl.classname,tcl.codelevel,tei.funds,tfs.fundsname, tei.entryretention,tei.filedate from tb_entry_index tei LEFT JOIN tb_data_node tdn on tei.nodeid = tdn.nodeid LEFT JOIN tb_classification tcl on tdn.classid = tcl.classid LEFT JOIN tb_funds tfs on tei.funds = tfs.funds where 1=1"
	+ ( emptyparam("funds")==false  ?  " and  tfs.fundsname = \'" + replace(param("funds"),"-","") + "\' " : "") 
}

${
  if(param("funds")!=null && param("funds")!=''){
  	"select funds,fundsname from tb_funds where fundsname = (\'" + replace(param("funds"),",","\',\'") + "\')"
  }else{
 	"select funds,fundsname from tb_funds where funds in(select funds from tb_entry_index)"
  }
 }
